import React from "react";
import crown from "../../Assets/crown.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCrown, faClipboardCheck } from "@fortawesome/free-solid-svg-icons";
const Footer = () => {
  return (
    <div className="flex  w-1/4 mx-auto container">
      <div>
        <FontAwesomeIcon className="text-yellow-900  text-6xl" icon={faCrown} />
        <p className="text-white text-center">crown</p>
      </div>

      <div className="mx-8">
        <div className="flex">

        <FontAwesomeIcon
          className="text-white  text-6xl"
          icon={faClipboardCheck}

        />
        <p className="border border-red-700 text-center rounded-full p-0 text-white bg-red-700 h-[30px] w-[20px] relative right-3 ">2</p>
        </div>

        <p className="text-white text-center">ab</p>
      </div>
      <div>
        <FontAwesomeIcon className="text-yellow-900 text-6xl font-extrabold" icon={faCrown} />
        <p className="text-white text-center">crown</p>
      </div>

      <div className="mx-8">
        <FontAwesomeIcon
          className="text-white  text-6xl"
          icon={faClipboardCheck}
        />
        <p className="text-white text-center">ab</p>
      </div>
    </div>
  );
};

export default Footer;
